import React,{useState} from "react";
import './style.css'
import {userSiginup} from '../../services/Api'
function Signup() {
  const [user,setUser] = useState({name:"",email:"",password:"",confirm:""})
  return (
    <div className='content-holder'>
    <div className='page-header'>JOIN US</div>
    <hr className='break-line'/>
    <form className='input-form' onSubmit={(e)=>{e.preventDefault()}}>
      <input className='text-input' name="" value={user.name} type='text' placeholder='user@email.com'></input>
      <input className='text-input' name="" value={user.email} type='text' placeholder='user@email.com'></input>
      <input className='text-input'name="" value={user.password} type='password' placeholder='password'></input>
      <input className='text-input'name="" value={user.confirm} type='password' placeholder=' confirm password'></input>
      <button className='submit-btn' name="" value={user}type='submit'>SIGNUP</button>
    </form>
  </div>
  );
}

export default Signup;
